// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmScrim 
} from '@vime/core';

import { define } from '../lib';


define('vm-scrim', VmScrim);


export interface ScrimProps extends JSX.VmScrim, HTMLAttributes<HTMLVmScrimElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmScrimElement, ScrimProps>(
  'vm-scrim',
  new Set(['gradient','isVideoView','isControlsActive']),
);
